import React,{Component} from "react";
import foresightLogo from "./images/foresightLogo.png"

class Footer extends Component{
    render(){
        return (
            <footer className="container-fluid bg-dark">
                <div className="row">
                    <div className="col-lg-3">
                        <img src={foresightLogo} style={{'width':'200px', 'height':'auto'}}></img>
                        <p>Download the Foresight app on Google Playstore.</p>
                    </div>
                </div>
            </footer>
        );
    }
}

export default Footer
